                                    <div className='col-12 text-center'>
                                        <i className="text-primary fa-3x fa-solid fa-spinner fast-spin fa-spin"></i>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </section>
                </main>
            </>
        }
    </>
    );

}
